(window.webpackJsonp=window.webpackJsonp||[]).push([[879],{1233:function(n,h,i){"use strict";i.r(h);var t=i(44),c=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-1766-đi-vao-chu-đien"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1766-đi-vao-chu-đien"}},[n._v("#")]),n._v(" Chương 1766: Đi vào chủ điện")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("“Dục lão quỷ, ngươi muốn cùng ta cướp?”"),i("br"),i("br"),n._v("Da đầu nổ tung, Bạch tôn giả toàn thân lông dựng lên."),i("br"),i("br"),n._v("60 giọt tích huyết trùng sinh cảnh giới Cổ Thánh chi huyết, đã nằm ngoài dự đoán của nó, cái tên này vậy mà cũng muốn cướp, để nó sắp phát điên."),i("br"),i("br"),n._v("“Ngươi mua của ngươi, ta mua ta, cái gì gọi là cướp?” Dục lão quỷ mí mắt vừa nhấc, cười nhạo nói: “Ngươi nếu là nguyện ý ra giá cao hơn cách, ra là được, dù sao, cái này danh ngạch, ta cũng muốn!”"),i("br"),i("br"),n._v("“Còn lại còn có hai cái danh ngạch, ngươi chẳng lẽ không thể đi mua?” Bạch tôn giả cắn răng."),i("br"),i("br"),n._v("“Ngươi coi ta khờ ah, phía sau càng ngày càng quý, ta Linh tộc, tuy là cao thủ nhiều như mây, nhưng cũng không phải coi tiền như rác!”"),i("br"),i("br"),n._v("Dục lão quỷ hừ một tiếng, nói: “Vừa rồi vị này Tiểu Trương sư đã nói, người trả giá cao được, dù sao đều là đấu giá, ngươi ra sáu mươi, vậy ta liền ra sáu mươi lăm!”"),i("br"),i("br"),n._v("“Ngươi...”"),i("br"),i("br"),n._v("Tức giận thân thể run rẩy, Bạch tôn giả nhưng cũng không có cách nào."),i("br"),i("br"),n._v("Nếu là đấu giá, đương nhiên là người trả giá cao được, không có khả năng không cho người khác đấu giá!"),i("br"),i("br"),n._v("“Ta ra sáu mươi sáu!” Nhẫn nhịn hồi lâu, Bạch tôn giả nói."),i("br"),i("br"),n._v("“Sáu mươi bảy!”"),i("br"),i("br"),n._v("“Sáu mươi tám!” Bạch tôn giả muốn giết người."),i("br"),i("br"),n._v("“Sáu mươi chín!”"),i("br"),i("br"),n._v("“Bảy mươi...”"),i("br"),i("br"),n._v("Dục lão quỷ một mặt lãnh đạm."),i("br"),i("br"),n._v("“Ngươi rất tốt... Bảy mươi lăm!” Cũng lại kìm nén không được, Bạch tôn giả điên cuồng: “Dục lão quỷ, ngươi còn dám tiếp tục nữa, đừng trách ta hiện tại liền trở mặt với ngươi!”"),i("br"),i("br"),n._v("“Ha ha, tốt, ta nhường ngươi!”"),i("br"),i("br"),n._v("Gặp đã mang lên bảy mươi lăm, Dục lão quỷ cười một tiếng, lại không nói lời nào."),i("br"),i("br"),n._v("Hắn đã nhìn ra, đầu thánh thú này nằm ở bên bờ biên giới sắp sụp đổ, lại kích thích đi xuống, làm không cẩn thận, thật sẽ đánh lên."),i("br"),i("br"),n._v("Tuy là thực lực của hắn, cũng không sợ hãi, có thể đối mặt một cái làm chuyện điên rồ Thánh thú, bốn phía còn có tên sư đường, Chư Tử bách gia vô số cường giả vây quanh, còn là lòng vẫn còn sợ hãi."),i("br"),i("br"),n._v("“Cho!”"),i("br"),i("br"),n._v("Thấy hắn không tại tranh đoạt, Bạch tôn giả thở phào nhẹ nhõm, móng vuốt run lên, một cái bình ngọc hướng Trương Huyền bay tới."),i("br"),i("br"),n._v("Ẩn chứa trong đó 75 giọt, đạt tới tích huyết trùng sinh cảnh giới Thánh thú chi huyết."),i("br"),i("br"),n._v("Thánh thú hình thể to lớn, 75 giọt đối với nhân loại tới nói, số lượng rất lớn, nhưng đối với Thánh thú tới nói, không tính là gì... Chỉ bất quá, bọn chúng muốn tấn thăng, dựa vào là huyết mạch cùng thiên phú, so với nhân loại càng khó!"),i("br"),i("br"),n._v("Tích huyết trùng sinh cảnh giới cao thủ, số lượng rõ ràng so với nhân loại, Dị Linh tộc đều ít hơn nhiều."),i("br"),i("br"),n._v("Vì lẽ đó, những này là nó hao tốn vô số đại giới, mới để dành tới, đưa ra ngoài, một hồi nhức nhối."),i("br"),i("br"),n._v("“Cái thứ hai danh ngạch, phân cho Thánh thú nhất tộc, cái thứ ba danh ngạch, giá khởi đầu... 100 giọt Cổ Thánh chi huyết!” Trương Huyền cười cười, nói."),i("br"),i("br"),n._v("“100 giọt?” Lông mày nhảy dựng, Dục lão quỷ vẻ mặt cứng đờ, kém chút chửi ầm lên: “Ngươi tại sao không đi cướp!”"),i("br"),i("br"),n._v("Vừa rồi mới 60 giọt, trực tiếp lật tiếp cận gấp đôi... Ngươi cố ý a?"),i("br"),i("br"),n._v("Vốn cho rằng giọt thứ ba, coi như giá cả tăng thêm, 70 giọt cũng là cực hạn, vì lẽ đó, mới không cùng Bạch tôn giả tranh, không nghĩ tới, cái tên này, như vậy không có đạo đức điểm mấu chốt."),i("br"),i("br"),n._v("“Hiện tại Chư Tử bách gia ba cái danh ngạch, Thánh thú nhất tộc hai cái, liền các ngươi chỉ có một cái, có thích mua hay không, không mua, ta liền không bán...”"),i("br"),i("br"),n._v("Một mặt cười khanh khách nhìn qua, Trương Huyền khóe miệng nâng lên: “Mặt khác, nói thật cho ngươi biết... Ta chính là tại cướp, liền nhìn ngươi có hay không cho!”"),i("br"),i("br"),n._v("Có cơ hội hố cái tên này, làm sao có thể bỏ qua."),i("br"),i("br"),n._v("Dù sao mua cùng không mua, chính mình cũng không chịu thiệt."),i("br"),i("br"),n._v("“Ngươi...” Dục lão quỷ tức giận sắp nổ tung."),i("br"),i("br"),n._v("“Không bằng đồng ý, chúng ta Linh tộc Cổ Thánh chi huyết, coi như cho hắn, một cái nhân tộc danh sư cũng khẳng định không thể dùng, cùng lắm thì... Chờ hắn rời đi chủ điện, tìm cơ hội giết, lại đem đồ vật cướp về chính là...”"),i("br"),n._v("Dị Linh tộc một đầu Cổ Thánh lặng lẽ truyền âm."),i("br"),i("br"),n._v("Dị Linh tộc Cổ Thánh chi huyết, sát lục chi khí, nồng đậm giống như thực chất, Bất Hủ cảnh cường giả, tới gần đều không làm được, chớ nói chi là luyện hóa!"),i("br"),i("br"),n._v("Đối phương một cái nhân loại danh sư, cầm tới cũng vô dụng, đã như vậy... Không bằng đáp ứng trước, cùng lắm thì tìm cơ hội lại cướp về, thuận tiện đem cái tên này giết, để tiết mối hận trong lòng!"),i("br"),i("br"),n._v("“Ừm!”"),i("br"),i("br"),n._v("Dục lão quỷ vẻ mặt lúc này mới khôi phục một chút, hừ một tiếng nói: “100 giọt, liền 100 giọt, hiện tại ta cho ngươi hai trăm, ngươi đem thứ ba, cái thứ tư danh ngạch, tất cả đều bán cho ta!”"),i("br"),i("br"),n._v("“Đều bán cho ngươi?”"),i("br"),i("br"),n._v("“Không sai, bọn họ đều đã mua, còn lại, chắc chắn sẽ không tiếp tục, ngươi đập giá cả lại cao hơn, cũng vô dụng, không bằng cùng một chỗ bán cho ta! Ta cho ngươi tương đồng giá cả.” Dục lão quỷ nói."),i("br"),i("br"),n._v("Dù sao đều là há mồm chờ sung rụng, cũng không quan tâm."),i("br"),i("br"),n._v("“Tốt!” Dừng lại một chút, Trương Huyền gật đầu."),i("br"),i("br"),n._v("Đối phương nói không sai, Chư Tử bách gia cùng Thánh thú, đều mua danh ngạch, lại để cho kỳ hoa phí lớn đánh đổi mua sắm, khẳng định rất khó, đã như vậy, còn không bằng một hơi thở bán cho đối phương."),i("br"),i("br"),n._v("Dù sao, đến chủ điện, đi nhiều hơn nữa Dị Linh tộc nhân, cũng phải bị bản thân âm chết, coi như bọn họ cho mình đưa bảo bối."),i("br"),i("br"),n._v("“Cho!”"),i("br"),i("br"),n._v("Thấy hắn đồng ý, Dục lão quỷ thở phào nhẹ nhõm, ngón tay búng một cái, hai bình ngọc bay tới."),i("br"),i("br"),n._v("Trương Huyền tiện tay nhận lấy, nhìn thấy trong đó mỗi một bình ngọc, đều có một trăm giọt huyết dịch, lúc này mới thoả mãn gật gật đầu."),i("br"),i("br"),n._v("“Ngươi phải cẩn thận, Dị Linh tộc Cổ Thánh trong máu, một khi sót lại ý niệm của bọn nó, hoàn toàn có thể tích huyết trùng sinh, đối ngươi tiến hành đánh lén...”"),i("br"),i("br"),n._v("Dường như nhìn ra Dục lão quỷ không có ý tốt, Trương Hoằng Thiên truyền âm."),i("br"),i("br"),n._v("Cổ Thánh đạt tới tích huyết trùng sinh cảnh giới, một giọt máu chính là một cái sinh mệnh, tuy là khôi phục lại thực lực bản thân, rất phiền phức, không biết phải hao phí bao lâu, nhưng khôi phục lại có thể chém giết Kim Thân cảnh, còn là rất dễ dàng."),i("br"),i("br"),n._v("“Ta biết!” Trương Huyền cười cười."),i("br"),i("br"),n._v("Vừa rồi mở ra nắp bình thời điểm, đã đem chân khí quán thâu vào, bên trong xác thực lưu lại đối phương ý niệm, Cổ Thánh có thể vượt qua Thiên đạo, nhưng đạo ý niệm này quá mức yếu kém, căn bản chống lại chẳng qua!"),i("br"),i("br"),n._v("Chỉ thoáng cái, liền toàn bộ giết chết."),i("br"),i("br"),n._v("Không còn ý niệm, coi như huyết dịch hoạt tính cực lớn, muốn lần nữa phục sinh chi phí tôn bộ dáng, không có vài vạn năm tích lũy, cũng làm không được."),i("br"),i("br"),n._v("Thời gian dài như vậy, khẳng định sớm đã bị dùng hết."),i("br"),i("br"),n._v("“Nếu như không cách nào xử lý, ta có thể ra tay!” Trương Hoằng Thiên nói."),i("br"),i("br"),n._v("“Đa tạ lão tổ, ta có thể xử lý!” Trương Huyền gật gật đầu."),i("br"),i("br"),n._v("“Danh ngạch đã phân phối xong, chuẩn bị lên đường đi!”"),i("br"),i("br"),n._v("Danh ngạch bán đấu giá xong, tiếp tục thủ tại chỗ này cũng không có cái gì ý nghĩa, Nhan Thanh Cổ Thánh, mở miệng lần nữa."),i("br"),i("br"),n._v("Trương Huyền gật đầu, không nói thêm lời, dựa theo ở giữa định tốt danh ngạch, đem người mang tại sau lưng, Tiểu Phù Phù bay lên, bao phủ ở bên trong, thẳng tắp hướng trước mắt chủ điện bay đi."),i("br"),i("br"),n._v("Thánh thú có hai cái danh ngạch, phái ra một đầu bạch hồ cùng một đầu màu đỏ báo, hẳn là đều cùng Bạch tôn giả liên quan đến."),i("br"),i("br"),n._v("Dị Linh tộc thì là ba đầu Bất Hủ cảnh đại viên mãn cường giả, trên mặt nhìn không ra biểu lộ, cũng không nói chuyện, không biết cụ thể mạnh bao nhiêu."),i("br"),i("br"),n._v("Còn Chư Tử bách gia, lại tăng lên một vị cao thủ, cùng Nhan Tiết tương xứng."),i("br"),i("br"),n._v("Tóm lại, lần này có thể đi vào, loại trừ Trương Huyền, yếu nhất đều là Bất Hủ cảnh đại viên mãn, có thể xưng Cổ Thánh phía dưới mạnh nhất."),i("br"),i("br"),n._v("“Đi vào đi!”"),i("br"),i("br"),n._v("Ông!"),i("br"),i("br"),n._v("Tiểu Phù Phù cùng chủ điện phong ấn vừa tiếp xúc, lập tức hòa vào trong đó, đám người trong chốc lát biến mất tại nguyên chỗ, cũng lại không nhìn thấy tung tích..."),i("br"),i("br"),n._v("Người đăng: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-1777"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-1779"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=c.exports}}]);